from functools import lru_cache

def min_inversions_in_merged_binary_string(N, A, B):

    @lru_cache(None)
    def go(i, j, zeros):
        if i == -1 or j == -1:
            return 0
        tmpi = 2 ** 31
        tmpj = 2 ** 31
        if i >= 0:
            if A[i] == '1':
                tmpi = go(i - 1, j, zeros) + zeros
            else:
                tmpi = go(i - 1, j, zeros + 1)
        if j >= 0:
            if B[j] == '1':
                tmpj = go(i, j - 1, zeros) + zeros
            else:
                tmpj = go(i, j - 1, zeros + 1)
        return min(tmpi, tmpj)
    return go(N - 1, N - 1, 0)

